import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import logo from "../assets/logo.png";

const Styles = styled.div`
  .carts {
    padding: 20px 0;
  }

  .carts .cart {
    padding: 15px;
    background: #eeeeee;
    border-radius: 8px;
    margin-bottom: 20px;
  }

  .carts .title {
    font-size: 20px;
    font-weight: bold;
    margin: 20px 0;
  }

  .carts .title a {
    color: #000;
  }

  .carts .text {
    margin-bottom: 10px;
  }

  .carts .cart-image {
    width: 100%;
    height: auto;
    border-radius: 8px;
  }

  .carts .buttons .col-6:nth-child(1) {
    padding-right: 5px;
  }

  .carts .buttons .col-6:nth-child(2) {
    padding-left: 5px;
  }

  .carts .button-third,
  .carts .button-fourth {
    width: 100%;
  }
`;

export default function Cart() {
  return (
    <Styles>
      <div>
        <div class="cart">
          <div class="row">
            <div class="col-12 image">
              <Link to="/">{/* <img src={logo} alt="Logo" /> */}</Link>
            </div>
            <h5 class="col-12 title">
              <Link to="/">Anasayfa</Link>
            </h5>
            <div class="col-12 text">
              Müslümanların üzerine farz kılınan ibadetlerden biri de zekâttır.
              Zekât yardımlaşma demektir, ümmet...
            </div>
            <div class="col-12 mt-auto">
              <div class="row buttons">
                <div class="col-6">
                  <button type="button" class="btn button-third">
                    DETAY
                  </button>
                </div>
                <div class="col-6">
                  <button type="button" class="btn button-fourth">
                    BAĞIŞ YAP
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </Styles>
  );
}
